An individual with a disability is a person who: (1) has a physical or
                mental impairment that substantially limits one or more major life activities;
                OR (2) has a record of such impairment; OR (3) is regarded as having such impairment.

Một người khuyết tật là một người: (1) có thể chất hoặc
                suy giảm tinh thần làm hạn chế đáng kể một hoặc nhiều hoạt động sinh hoạt chính;
                HOẶC (2) có hồ sơ về sự suy yếu đó; HOẶC (3) được coi là có suy yếu như vậy.
